import React from 'react'
import Project from './Project'

import projectsD from './projectsData'

function MyWork () {
    const myProjects = projectsData.map(item => <Project project={item}/>)
    const textStyle = {
        textAlign: 'center'
    }
    return (
        <div>
            <h1 style={textStyle}>My Work</h1>
            <div class="projects">
                {myProjects}
            </div>
        </div>
    ) 
}

export default MyWork
